package org.apache.commons.vfs2.filter;

import org.apache.commons.vfs2.FileObject;
import org.apache.commons.vfs2.FileName;
import org.apache.commons.vfs2.FileSelectInfo;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import static org.junit.jupiter.api.Assertions.*;
import static org.mockito.Mockito.*;

class NameFileFilterTest1 {

    private NameFileFilter filter;
    private String[] approvedFilenames;

    @BeforeEach
    void setUp() {
        // Step 0: Establish a filtering configuration that recognizes two approved filenames
        approvedFilenames = new String[]{"file1.txt", "file2.txt"};
        filter = new NameFileFilter(approvedFilenames);
    }

    @Test
    void testCaseSensitiveFilenameMatching() {
        // Step 1: Prepare a resource with a name that exactly matches the first approved filename
        FileSelectInfo resourceFirstApproved = createMockFileSelectInfo("file1.txt");

        // Step 2: Submit the resource to the filename filtering system
        boolean firstResourceResponse = filter.accept(resourceFirstApproved);

        // Step 3: Assert the system accepts the resource using standard equality assertions
        assertTrue(firstResourceResponse, "The system should accept a resource with name matching the first approved filename");

        // Step 4: Prepare a resource with a name that exactly matches the second approved filename
        FileSelectInfo resourceSecondApproved = createMockFileSelectInfo("file2.txt");

        // Step 5: Submit the resource to the filename filtering system
        boolean secondResourceResponse = filter.accept(resourceSecondApproved);

        // Step 6: Assert the system accepts the resource using standard equality assertions
        assertTrue(secondResourceResponse, "The system should accept a resource with name matching the second approved filename");

        // Step 7: Prepare a resource with a name that differs in capitalization from the first approved filename
        FileSelectInfo resourceFirstMismatchCase = createMockFileSelectInfo("FILE1.TXT");

        // Step 8: Submit the resource to the filename filtering system
        boolean firstMismatchCaseResponse = filter.accept(resourceFirstMismatchCase);

        // Step 9: Assert the system rejects the resource using standard equality assertions
        assertFalse(firstMismatchCaseResponse, "The system should reject a resource with name differing in case from the first approved filename");

        // Step 10: Prepare a resource with a name that differs in capitalization from the second approved filename
        FileSelectInfo resourceSecondMismatchCase = createMockFileSelectInfo("FILE2.TXT");

        // Step 11: Submit the resource to the filename filtering system
        boolean secondMismatchCaseResponse = filter.accept(resourceSecondMismatchCase);

        // Step 12: Assert the system rejects the resource using standard equality assertions
        assertFalse(secondMismatchCaseResponse, "The system should reject a resource with name differing in case from the second approved filename");

        // Step 13: Prepare a resource with a name that does not appear in the approval list
        FileSelectInfo resourceUnrecognized = createMockFileSelectInfo("unknown.txt");

        // Step 14: Submit the resource to the filename filtering system
        boolean unrecognizedResourceResponse = filter.accept(resourceUnrecognized);

        // Step 15: Assert the system rejects the resource using standard equality assertions
        assertFalse(unrecognizedResourceResponse, "The system should reject a resource with name not in the approval list");
    }

    private FileSelectInfo createMockFileSelectInfo(String filename) {
        FileSelectInfo fileSelectInfo = mock(FileSelectInfo.class);
        FileObject fileObject = mock(FileObject.class);
        FileName fileName = mock(FileName.class);

        when(fileSelectInfo.getFile()).thenReturn(fileObject);
        when(fileObject.getName()).thenReturn(fileName);
        when(fileName.getBaseName()).thenReturn(filename);

        return fileSelectInfo;
    }
}

