package org.apache.commons.vfs2.filter;

import org.apache.commons.vfs2.FileObject;
import org.apache.commons.vfs2.FileSystemManager;
import org.apache.commons.vfs2.VFS;
import org.apache.commons.vfs2.FileSelectInfo;
import org.junit.jupiter.api.Test;
import java.util.ArrayList;
import java.util.List;
import static org.junit.jupiter.api.Assertions.*;

public class NameFileFilterTest1 {

    @Test
    public void testCaseSensitiveNameFileFilter() throws Exception {
        // Step 0: Construct a list containing two filename strings
        List<String> filenameList = new ArrayList<>();
        filenameList.add("file1.txt");
        filenameList.add("document.pdf");

        // Step 1: Instantiate the Name File Filter with case-sensitive mode enabled
        NameFileFilter nameFileFilter = new NameFileFilter(filenameList, IOCase.SENSITIVE);

        // Step 2: Create a helper mechanism to generate file selection information objects
        FileSystemManager vfsManager = VFS.getManager();

        // Step 3: Prepare a file selection object representing an uppercase variant of the first filename
        FileObject uppercaseFile = vfsManager.resolveFile(filenameList.get(0).toUpperCase());

        // Step 4: Invoke the filter's accept method with the uppercase file selection object
        boolean acceptResult1 = nameFileFilter.accept(createFileSelectInfo(uppercaseFile));

        // Step 5: Verify the filter rejects the file due to case mismatch
        assertFalse(acceptResult1, "Filter should reject uppercase variant due to case sensitivity");

        // Step 6: Prepare a file selection object representing an exact match of the second filename
        FileObject exactMatchFile = vfsManager.resolveFile(filenameList.get(1));

        // Step 7: Invoke the filter's accept method with the exact match file selection object
        boolean acceptResult2 = nameFileFilter.accept(createFileSelectInfo(exactMatchFile));

        // Step 8: Confirm the filter accepts the file
        assertTrue(acceptResult2, "Filter should accept exact match");

        // Step 9: Prepare a file selection object representing a mixed-case variant of the second filename
        FileObject mixedCaseFile = vfsManager.resolveFile(mixedCase(filenameList.get(1)));

        // Step 10: Invoke the filter's accept method with the mixed-case file selection object
        boolean acceptResult3 = nameFileFilter.accept(createFileSelectInfo(mixedCaseFile));

        // Step 11: Validate the filter rejects the file due to case mismatch
        assertFalse(acceptResult3, "Filter should reject mixed-case variant due to case sensitivity");

        // Step 12: Prepare a file selection object representing a filename not present in the configured list
        FileObject unknownFile = vfsManager.resolveFile("unknown_file.txt");

        // Step 13: Invoke the filter's accept method with the unknown file selection object
        boolean acceptResult4 = nameFileFilter.accept(createFileSelectInfo(unknownFile));

        // Step 14: Verify the filter rejects the file regardless of case
        assertFalse(acceptResult4, "Filter should reject unknown file");
    }

    // Helper method to create FileSelectInfo objects
    private FileSelectInfo createFileSelectInfo(FileObject fileObject) {
        DefaultFileSelectorInfo fileSelectInfo = new DefaultFileSelectorInfo();
        fileSelectInfo.setFile(fileObject);
        return fileSelectInfo;
    }

    // Helper method to create mixed-case filenames
    private String mixedCase(String filename) {
        StringBuilder result = new StringBuilder();
        for (int i = 0; i < filename.length(); i++) {
            char c = filename.charAt(i);
            if (i % 2 == 0) {
                result.append(Character.toUpperCase(c));
            } else {
                result.append(Character.toLowerCase(c));
            }
        }
        return result.toString();
    }

    // Simple implementation of DefaultFileSelectorInfo since we can't inspect it
    private static class DefaultFileSelectorInfo implements FileSelectInfo {
        private FileObject file;

        public void setFile(FileObject file) {
            this.file = file;
        }

        @Override
        public FileObject getFile() {
            return file;
        }
    }
}

package org.apache.commons.vfs2.filter;

