public class NameFileFilterTest1 {

    @Test
    public void testCaseSensitiveNameFiltering() throws Exception {
        // Step 0: Establish a filtering rule configured to recognize exactly two approved file names with strict case-sensitivity enabled
        String[] approvedNames = {"ApprovedFile1.txt", "ApprovedFile2.txt"};
        NameFileFilter filter = new NameFileFilter(approvedNames);

        // Get filesystem manager to create test files
        FileSystemManager fsManager = VFS.getManager();

        // Step 1: Prepare a file whose name matches one of the approved names but with different capitalization
        FileObject mismatchedCaseFile = fsManager.resolveFile("ram:///approvedfile1.txt");
        mismatchedCaseFile.createFile();

        // Step 2: Evaluate the file with mismatched capitalization against the filtering rule
        boolean evaluationResult1 = filter.accept(new TestFileSelectInfo(mismatchedCaseFile));

        // Step 3: Confirm the system rejects the file due to the case mismatch
        assertFalse(evaluationResult1, "File with mismatched case should be rejected");

        // Step 4: Prepare a file whose name exactly matches the second approved name with identical capitalization
        FileObject exactMatchFile = fsManager.resolveFile("ram:///ApprovedFile2.txt");
        exactMatchFile.createFile();

        // Step 5: Evaluate the file with exact capitalization match against the filtering rule
        boolean evaluationResult2 = filter.accept(new TestFileSelectInfo(exactMatchFile));

        // Step 6: Verify the system accepts the file as valid
        assertTrue(evaluationResult2, "File with exact name match should be accepted");

        // Step 7: Prepare a file whose name matches the second approved name but uses mixed capitalization
        FileObject mixedCaseFile = fsManager.resolveFile("ram:///APPROVEDfile2.TXT");
        mixedCaseFile.createFile();

        // Step 8: Evaluate the file with mixed capitalization against the filtering rule
        boolean evaluationResult3 = filter.accept(new TestFileSelectInfo(mixedCaseFile));

        // Step 9: Ensure the system rejects this variant because of the case difference
        assertFalse(evaluationResult3, "File with mixed case should be rejected");

        // Step 10: Prepare a file whose name does not appear in the approved list at all
        FileObject unapprovedFile = fsManager.resolveFile("ram:///RandomFile.txt");
        unapprovedFile.createFile();

        // Step 11: Evaluate the unapproved file against the filtering rule
        boolean evaluationResult4 = filter.accept(new TestFileSelectInfo(unapprovedFile));

        // Step 12: Confirm the system rejects the file for not matching any approved name
        assertFalse(evaluationResult4, "File not in approved list should be rejected");
    }

    // Simple implementation of FileSelectInfo for testing purposes
    private static class TestFileSelectInfo implements org.apache.commons.vfs2.FileSelectInfo {
        private final FileObject file;

        public TestFileSelectInfo(FileObject file) {
            this.file = file;
        }

        @Override
        public FileObject getFile() {
            return file;
        }

        @Override
        public String getName() {
            return file.getName().getBaseName();
        }

        @Override
        public int getDepth() {
            return 0; // Simple implementation for testing
        }

        @Override
        public org.apache.commons.vfs2.FileObject getBaseFolder() {
