import static org.junit.jupiter.api.Assertions.assertTrue;

@Nested
class NameFileFilterTest1 {

    @Test
    void testNameFileFilterWithSensitiveCase() throws Exception {
        // Setup
        List<String> list = new ArrayList<>();
        list.add("test1.txt");
        list.add("test2.txt");

        NameFileFilter filter = new NameFileFilter(IOCase.SENSITIVE, list);

        // Test case 1: "TEST1.txt" should not match (case sensitive)
        File file1 = new File("TEST1.txt");
        FileSelectInfo fileSelectInfo1 = createFileSelectInfo(file1);
        boolean result1 = filter.accept(fileSelectInfo1);
        assertFalse(result1);

        // Test case 2: "test2.txt" should match
        File file2 = new File("test2.txt");
        FileSelectInfo fileSelectInfo2 = createFileSelectInfo(file2);
        boolean result2 = filter.accept(fileSelectInfo2);
        assertTrue(result2);

        // Test case 3: "Test2.txt" should not match (case sensitive)
        File file3 = new File("Test2.txt");
        FileSelectInfo fileSelectInfo3 = createFileSelectInfo(file3);
        boolean result3 = filter.accept(fileSelectInfo3);
        assertFalse(result3);

        // Test case 4: "test.xxx" should not match
        File file4 = new File("test.xxx");
        FileSelectInfo fileSelectInfo4 = createFileSelectInfo(file4);
        boolean result4 = filter.accept(fileSelectInfo4);
        assertFalse(result4);
    }

    /**
     * Helper method to create a FileSelectInfo from a File
     */
    private FileSelectInfo createFileSelectInfo(File file) throws Exception {
        FileSystemManager manager = VFS.getManager();
        FileObject fileObject = manager.toFileObject(file);
        DefaultFileSelectorInfo fileSelectInfo = new DefaultFileSelectorInfo();
        fileSelectInfo.setFile(fileObject);
        return fileSelectInfo;
    }
}

