import java.io.File;
import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.junit.jupiter.api.Assertions.assertFalse;

public class FileNameFilterTest {

    private FileNameFilter filter;

    @BeforeEach
    void setUp() {
        // Configure the filtering system to accept files named "test1.txt" 
        // using default case-sensitive matching behavior
        filter = new FileNameFilter();
        filter.setTargetFileName("test1.txt");
    }

    @Test
    void testFileNameFiltering() {
        // Step 1: Submit a file named "test1.txt"
        File file1 = new File("test1.txt");
        boolean response_1 = filter.accept(file1);

        // Step 2: Verify the system accepts the file as a valid match
        assertTrue(response_1, "File 'test1.txt' should be accepted");

        // Step 3: Submit a file named "test2.txt"
        File file2 = new File("test2.txt");
        boolean response_2 = filter.accept(file2);

        // Step 4: Confirm the system rejects the file since the name differs from the configured target
        assertFalse(response_2, "File 'test2.txt' should be rejected");

        // Step 5: Submit a file named "Test2.txt" with different casing
        File file3 = new File("Test2.txt");
        boolean response_3 = filter.accept(file3);

        // Step 6: Ensure the system rejects the file due to case-sensitive matching rules
        assertFalse(response_3, "File 'Test2.txt' should be rejected due to case sensitivity");

        // Step 7: Submit a file named "test.xxx" with a different extension
        File file4 = new File("test.xxx");
        boolean response_4 = filter.accept(file4);

        // Step 8: Verify the system rejects the file because the complete filename 
        // does not match the configured criteria
        assertFalse(response_4, "File 'test.xxx' should be rejected due to different extension");
    }

    // Simple implementation of FileNameFilter for testing purposes
    private static class FileNameFilter {
        private String targetFileName;

        public void setTargetFileName(String targetFileName) {
            this.targetFileName = targetFileName;
        }

        public boolean accept(File file) {
            return file.getName().equals(targetFileName);
        }
    }
}

