public class FtpFileSystemConfigBuilderTest1 {

    @Test
    public void testControlEncodingConfiguration() {
        // Step 0: Establish a fresh configuration context for file system operations
        FileSystemOptions file_system_options = new FileSystemOptions();

        // Step 1: Obtain the configuration manager responsible for file transfer protocol settings
        FtpFileSystemConfigBuilder config_builder = FtpFileSystemConfigBuilder.getInstance();

        // Step 2: Select a standard character encoding format to use for control channel communication
        String control_channel_encoding = "UTF-8";

        // Step 3: Configure the system to use the encoding by providing it as a text name
        config_builder.setControlEncoding(file_system_options, control_channel_encoding);

        // Step 4: Verify the system correctly stores the encoding as the original format
        String retrievedEncoding = config_builder.getControlEncoding(file_system_options);
        assertEquals(control_channel_encoding, retrievedEncoding, "Control encoding should match the configured value");

        // Step 5: Verify the system correctly retrieves the encoding as its text representation
        String retrieved_encoding_name = config_builder.getControlEncoding(file_system_options);

        // Step 6: Ensure consistency between the original format and text representation retrievals
        assertEquals(control_channel_encoding, retrieved_encoding_name, "Retrieved encoding name should match original");

