        if (writeFolder != null) {
            writeFolder.close();
        }

        // Step 20: Close the base folder file object if it is not null
        if (baseTestFolder != null) {
            baseTestFolder.close();
        }

        // Step 21: Trigger garbage collection multiple times with intervening thread sleep intervals to allow cached resources to be released
        for (int i = 0; i < 3; i++) {
            System.gc();
            Thread.sleep(50);
        }

        // Step 22: Instruct the manager to free unused resources
        if (fileSystemManager != null) {
            fileSystemManager.freeUnusedResources();
        }

        // Step 23: Close the file system manager
        if (fileSystemManager != null) {
            fileSystemManager.close();
