package org.apache.commons.vfs2;

import org.apache.commons.vfs2.impl.DefaultFileSystemManager;
import org.apache.commons.vfs2.impl.StandardFileSystemManager;
import org.apache.commons.vfs2.impl.DefaultFileReplicator;
import org.apache.commons.vfs2.provider.local.DefaultLocalFileProvider;
import org.apache.commons.vfs2.provider.url.UrlFileProvider;
import org.apache.commons.vfs2.provider.TemporaryFileStore;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.io.TempDir;

import java.io.File;
import java.nio.file.Path;

import static org.junit.jupiter.api.Assertions.*;

public class FileSystemManagerTest {

    @TempDir
    private Path temporaryLocation;

    @Test
    public void testResolvePartialResourcePathToFileReference() throws Exception {
        // Step 1: Configure a file system manager with caching behavior, file replication capabilities, and temporary file storage
        DefaultFileSystemManager manager = new DefaultFileSystemManager();
        manager.setCacheStrategy(CacheStrategy.ON_RESOLVE);
        manager.setTemporaryFileStore(new TemporaryFileStore() {
            @Override
            public File allocateFile(String basename) throws FileSystemException {
                return new File(temporaryLocation.toFile(), basename);
            }
        });
        DefaultFileReplicator replicator = new DefaultFileReplicator();

        // Step 2: Register necessary file access providers including local files and network shares
        manager.addProvider(new String[]{"file"}, new DefaultLocalFileProvider());
        manager.addProvider(new String[]{"res"}, new UrlFileProvider());

        // Step 3: Initialize the file system manager
        ((StandardFileSystemManager) manager).init();

        // Step 4: Prepare base folders for read and write operations
        FileObject baseFolder = manager.resolveFile(temporaryLocation.toUri().toString());
        FileObject readFolder = manager.resolveFile(baseFolder, ".");
        FileObject writeFolder = manager.resolveFile(baseFolder, ".");

        // Step 5: Confirm the read location exists and is not at the root level
        assertTrue(readFolder.exists());
        assertNotEquals("/", readFolder.getName().getPath());

        // Step 6: Instruct the system to resolve the partial resource identifier 'res:test-data' into a file reference
        FileObject fileReference = manager.resolveFile("res:test-data");

        // Step 7 & 8: Verify that the resolved reference represents a regular file rather than a directory or other file type
        assertEquals(FileType.FILE, fileReference.getType());

        // Step 9: Release all file references by closing the read folder, write folder, and base folder
        readFolder.close();
        writeFolder.close();
        baseFolder.close();

        // Step 10: Trigger resource cleanup to allow background processes to free cached files
        manager.close();

        // Step 11: Wait briefly to permit concurrent operations to finish
        Thread.sleep(100);

        // Step 12: Close the file system manager to release all associated resources
        manager.close();

        // Step 13: Pause momentarily for any remaining threads to complete
        Thread.sleep(100);

        // Step 14: Confirm the temporary workspace is empty or removed
        FileObject tempDir = manager.resolveFile(temporaryLocation.toUri().toString());
        FileObject[] children = tempDir.getChildren();
        assertEquals(0, children.length);

        // Step 15: Close the global file system context
        VFS.close();
    }
}

