public class ReadOnlyFileCopyTest {

    @Test
    public void testCopyToReadOnlyFileFails() throws Exception {
        // Step 0: Confirm that the test environment has access to a properly configured remote file server
        FileSystemOptions options = new FileSystemOptions();
        Boolean configAvailable = FtpFileSystemConfigBuilder.getInstance().getRemoteVerification(options);

        // Step 1: Skip the test if the server is unavailable
        Assumptions.assumeTrue(configAvailable != null && configAvailable, 
            "Remote file server configuration not available, skipping test");

        // Step 3: Establish a working area within the file system
        File workingAreaFile = TemporaryFileStore.allocateFile("test_working_area");
        FileObject workingArea = VFS.getManager().toFileObject(workingAreaFile);

        FileObject readOnlyFile = null;
        FileObject sourceFile = null;

        try {
            // Step 4: Create a new file resource and mark it as read-only
            readOnlyFile = workingArea.resolveFile("readonly.txt");
            readOnlyFile.createFile();
            readOnlyFile.setWritable(false, false);

            // Step 5: Identify a source file within the same working area
            sourceFile = workingArea.resolveFile("source.txt");
            sourceFile.createFile();

            // Step 6: Attempt to transfer contents from source to read-only destination
            // Step 7: Verify that the system rejects this operation
            assertThrows(FileSystemException.class, () -> {
                ((AbstractFileObject) readOnlyFile).copyFrom(sourceFile, new AllFileSelector());
            });

            // Step 8: Restore write permissions to allow cleanup
            readOnlyFile.setWritable(true, false);

        } finally {
            // Steps 9-10: Clean up resources
            if (readOnlyFile != null) {
                try {
                    readOnlyFile.delete();
                } catch (Exception ignored) {}
            }
            if (sourceFile != null) {
                try {
                    sourceFile.delete();
                } catch (Exception ignored) {}
            }
            if (workingArea != null) {
                try {
                    workingArea.delete();
                } catch (Exception ignored) {}
            }
        }
    }
}

