        closeFileObjectIfAttached(writeTestFolder);
        closeFileObjectIfAttached(baseTestFolder);

        // Step 25: Trigger garbage collection multiple times with intervening delays
        for (int i = 0; i < 3; i++) {
            System.gc();
            Thread.sleep(50);
