        if (fileSystemManager != null) {
            fileSystemManager.close();
        }

        // Step 28: Pause briefly to allow threads to terminate
        Thread.sleep(100);

        // Step 29: Verify the temporary directory is empty or removed
        if (tempDir.exists()) {
            cleanDirectory(tempDir);
            assertTrue(isDirectoryEmpty(tempDir), "Temporary directory should be empty after test");
        }

        // Step 30: Close the VFS singleton
        VFS.close();
    }

    private void closeFileObjectIfAttached(FileObject fileObject) {
        if (fileObject != null && fileObject.isAttached()) {
            try {
                fileObject.close();
            } catch (FileSystemException e) {
                // Ignore
            }
        }
    }

    private void cleanDirectory(File directory) {
        if (directory.exists()) {
            File[] files = directory.listFiles();
            if (files != null) {
                for (File file : files) {
                    if (file.isDirectory()) {
                        cleanDirectory(file);
                    }
                    file.delete();
                }
            }
        }
    }

    private boolean isDirectoryEmpty(File directory) {
        if (!directory.exists() || !directory.isDirectory()) {
            return false;
        }
        File[] files = directory.listFiles();
        return files == null || files.length == 0;
    }
